import React from "react";
import "./importItem.css";

function ExpenseItem() {
  return (
    <div>
      <div>march 28th 2022</div>
      <div>
        <h2>car insurance</h2>
        <div>223 kr</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
